import React from "react";
import { useParams } from "react-router-dom";
import { useEffect } from "react";
import { useState } from "react";
import axios from "axios";

export default function Commits(props) {
  const params = useParams();
  const { repos } = props;
  const setRepo = {};
  const [commits, setCommits] = useState("");

  // if (repos.length > 0) {
  //   repos.map((repo) => {
  //     if (repo.id == params.id) {
  //       setRepo = repo;
  //     }
  //   });
  // }

  const url = `https://api.github.com/repos/Netflix/${setRepo.name}/commits`;

  async function getRepoData() {
    axios
      .get(`${url}`)
      .then((res) => {
        // console.log(res);
        const allCommits = res.data;
        console.log(allCommits);
        setCommits(allCommits);
      })
      .catch((error) => console.error(`Error: ${error}`));
  }

  useEffect(() => {
    getRepoData();
  }, []);

  if (commits.length > 0) {
    commits.map((commit) => {
      console.log(commit.commit.author.name);
      console.log(commit.commit.author.date);
    });
  }

  return <div>Commits Page</div>;
}
